	add("deirdre", "{\"term\":\"deirdre\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The foremost tragic heroine in the Ulster Cycle of Irish mythology. Daughter of Fedlimid mac Daill. At birth, Cathbad foretold that she would be very beautiful, but that kings and lords would go to war over her. She committed suicide\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1885\u0027\u0027 Frances Mabel Robinson, \u0027Mr. Butler\u0027s Ward\u0027, Vizetelly, page 95\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Deirdre\u0027\u0027, it seemed to him, was the most beautiful name in the world. But Mrs. Stanley had different views on nomenclature. She had never, she declared, heard so utterly preposterous a name. - - -\u0026quot;Theatre and saltpetre are both spelt that way, Arthur; depend upon it, it is Deirder - a sort of peasant name like Darby and Biddy, a corruption of something else.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A beautiful, but suicidal woman\", \"priority\":4}]}, \"synonyms\":{}}");

	add("deism", "{\"term\":\"deism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027déisme\u0027 from Latin \u0027deus\u0027 (god, deity) {{suffix||ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A philosophical belief in the existence of a god (or goddess) knowable through human reason; especially, a belief in a creator god unaccompanied by any belief in supernatural phenomena or specific religious doctrines\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1682\u0027\u0027, \u0027Religio Laici, Or A Layman\u0027s Faith\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If my supposition be true, then the consequence which I have assumed in my Poem may be also true; namely, that \u0027\u0027Deism\u0027\u0027, or the principles of natural worship, are only the faint remnants or dying flames of reveal\u0027d religion in the posterity of Noah\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1847\u0027\u0027, Julius Charles Hare \u0026amp; Augustus William Hare, \u0027Guesses at Truth\u0027, p.39\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"As the Epicureans had a \u0027\u0027Deism\u0027\u0027 without a God, so the Unitarians have a Christianity without a Christ, and a Jesus but no Saviour\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, page 786\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"In place of the idea which runs through the Tanakh and New Testament of a God intimately involved with his creation and providentially repeatedly intervening in it, there was the concept of a God who had certainly created the world and set up its laws in structures understandable by human reason, but who after that allowed it to go its own way, precisely because reason was one of his chief gifts to humanity, and order a gift to his creation. This was the approach to divinity known as \u0027\u0027deism\", \"priority\":7}]}, \"synonyms\":{}}");

	add("deiseal", "{\"term\":\"deiseal\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old irish (to 900)\"], \"text\":\"{{borrowing|ga|deiseal|lang\u003den}}, from Old irish (to 900) {{m|sga|dessel}}, from {{m|sga|dess||right, south}} + {{m|sga|sel||turn}}.* \u0027In the eyes of our early forefathers the daily course of the Sun, bringing about the alternation of light and darkness and the regular succession of the seasons, was the most striking example that man had of that divine order of the universe which served as a model for order and justice in terrestrial affairs. Hence to go \u0027\u0027\u0027dessel\u0027\u0027\u0027 or righthandwise, thus imitiating the course of the sun, was not only the right way to make a journey, but was likewise beneficial in other affairs of life, and was likely to lead to a prosperous result; whereas to go in the contrary direction (\u0027\u0027\u0027tuaithbel\u0027\u0027\u0027) would be a violation of the established order and would lead to harm.\u0027 — T. F. O\u0027Rahilly, \u0027Early Irish History and Mythology\u0027, Dublin (1946), pp. 296-297.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Motion towards the right, in the direction of the hands of a clock or of the apparent motion of the sun; a turning in this direction\", \"priority\":1}]}, \"synonyms\":{}}");

